"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[402],{402:e=>{e.exports=JSON.parse('{"en":{"main_title":"Romanesque style","topic":"Romanesque style","years":"VI-XIII","description":"Romanesque architecture is characterized by towering round arches, massive stone and brickwork, small windows, thick walls, and a propensity for housing art and sculpture depicting biblical scenes. Even if many of these structures are mainly tourist attractions or interesting historical subjects today.","exemple1":"Maria Laach Abbey","exemple2":"Durham Cathedral","exemple3":"Pisa Cathedral","exemple4":"Florence Baptistery"},"ua":{"main_title":"Романський стиль","topic":"Романський стиль","years":"VI-XIII","description":"Романська архітектура характеризується високими круглими арками, масивною кам\'яною та цегляною кладкою, невеликими вікнами, товстими стінами та схильністю до розміщення мистецтва та скульптури, що зображують біблійні сцени.","exemple1":"Абатство Марія Лаах","exemple2":"Даремський собор","exemple3":"Пізанський собор","exemple4":"Флорентійський баптистерій"},"es":{"main_title":"Estilo románico","topic":"estilo románico","years":"VI-XIII","description":"La arquitectura románica se caracteriza por imponentes arcos de medio punto, piedra maciza y ladrillo, ventanas pequeñas, paredes gruesas y una propensión a albergar arte y esculturas que representan escenas bíblicas. Incluso si muchas de estas estructuras son principalmente atracciones turísticas o sitios históricos interesantes sujetos hoy.","exemple1":"Abadía de María Laach","exemple2":"Catedral de Durham","exemple3":"Catedral de Pisa","exemple4":"Baptisterio de Florencia"},"specifical":{"image1":"maria-laach-abbey","image2":"durham-cathedral","image3":"pisa-cathedral","image4":"florence-baptistery"}}')}}]);